import axios from 'axios';
let userValue = '';
axios.defaults.baseURL = 'https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVinValues/';
const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    let value = axios({
        method: 'get',
        url: userValue,
        data: {}
      })
      .then(alert('Success'))
      .catch(err => console.error(err));// promise
}
export {getIN, sub};
